import { PoissonDiscPlugin } from "./PoissonDiscPlugin.js";
export async function loadPoissonDiscPlugin(engine, refresh = true) {
    engine.checkVersion("3.9.1");
    await engine.addPlugin(new PoissonDiscPlugin(engine), refresh);
}
